import React from 'react';
import { faEnvelope, faKey } from '@fortawesome/free-solid-svg-icons';

import Navbar from './Components/Navbar/Navbar';

import './App.css';
library.add(faEnvelope, faKey);
function App() {
  return (
    <div className="App">
     <Navbar/>
    </div>
  );
}

export default App;
